#include "common.h"
using namespace std;

namespace bestRotation {
/*
// TODO: copy problem statement here
 798. Smallest Rotation with Highest Score
 Hard
 
 180
 
 14
 
 Favorite
 
 Share
 Given an array A, we may rotate it by a non-negative integer K so that the array becomes A[K], A[K+1], A{K+2], ... A[A.length - 1], A[0], A[1], ..., A[K-1].  Afterward, any entries that are less than or equal to their index are worth 1 point.
 
 For example, if we have [2, 4, 1, 3, 0], and we rotate by K = 2, it becomes [1, 3, 0, 2, 4].  This is worth 3 points because 1 > 0 [no points], 3 > 1 [no points], 0 <= 2 [one point], 2 <= 3 [one point], 4 <= 4 [one point].
 
 Over all possible rotations, return the rotation index K that corresponds to the highest score we could receive.  If there are multiple answers, return the smallest such index K.
 
 Example 1:
 Input: [2, 3, 1, 4, 0]
 Output: 3
 Explanation:
 Scores for each K are listed below:
 K = 0,  A = [2,3,1,4,0],    score 2
 K = 1,  A = [3,1,4,0,2],    score 3
 K = 2,  A = [1,4,0,2,3],    score 3
 K = 3,  A = [4,0,2,3,1],    score 4
 K = 4,  A = [0,2,3,1,4],    score 3
 So we should choose K = 3, which has the highest score.
 
 
 
 Example 2:
 Input: [1, 3, 0, 2, 4]
 Output: 0
 Explanation:  A will always have 3 points no matter how it shifts.
 So we will choose the smallest K, which is 0.
 Note:
 
 A will have length at most 20000.
 A[i] will be in the range [0, A.length].
 */

class Solution {
public:
    int bestRotation(vector<int>& A) {
        return bestRotation_change(A);
    }
    int bestRotation2(vector<int>& A) {
        int n = A.size();
        vector<int> chg(n, 0);
        for (int i = 0; i < n; ++i) {
            if (A[i] == 0) {
                continue;
            }
            if (1+i < A[i]) {
                --chg[n+1+i-A[i]];
            } else {
                --chg[i-A[i]+1];
            }
            ++chg[(i+1)%n];
        }
        int res = 0, sum = chg[0], msum = 0;
        for (int i = 0; i < n; ++i) {
            sum += chg[i];
            if (sum > msum) {
                msum = sum;
                res = i;
            }
        }
        return res;
    }
    /**
     * https://leetcode.com/problems/smallest-rotation-with-highest-score/discuss/118725/C%2B%2BJavaPython-Solution-with-Explanation
     */
    int bestRotation_change(vector<int>& A) {
        int n = A.size();
        vector<int> change(n, 0);
        for (int i = 0; i < n; ++i) {
            change[(i-A[i]+n+1)%n] -= 1;
        }
        for (int i = 1; i < n; ++i) {
            change[i] += change[i-1] + 1;
        }
        return distance(change.begin(), max_element(change.begin(), change.end()));
    }
    int bestRotation_maxIntervalOverlap2(vector<int>& A) {
        int n = A.size();
        vector<int> active(n+1, 0);
        for (int i = 0; i < n; ++i) {
            int val = A[i];
            if (val > i) {
                ++active[i+1];
                --active[n+i-val+1];
            } else {
                ++active[0];
                --active[i-val+1];
                ++active[i+1];
            }
        }
        int res = 0;
        int max_cnt = 0;
        int cur = 0;
        for (int i = 0; i < n; ++i) {
            cur += active[i];
            if (cur > max_cnt) {
                max_cnt = cur;
                res = i;
            }
        }
        return res;
    }
    
    int bestRotation_maxIntervalOverlap(vector<int>& A) {
        int n = A.size();
        vector<int> start(n+1,0), end(n+1,0);
        for (int i = 0; i < n; ++i) {
            int val = A[i];
            if (val > i) {
                ++start[i+1];
                ++end[n+i-val];
            } else {
                ++start[0];
                ++end[i-val];
                if (i < n-1) {
                    ++start[i+1];
                    ++end[n-1];
                }
            }
        }
        int res = 0;
        int max_cnt = 0;
        int cur = 0;
        for (int i = 0; i < n; ++i) {
            cur += start[i];
            if (cur > max_cnt) {
                max_cnt = cur;
                res = i;
            }
            cur -= end[i];
        }
        return res;
    }
    /**
     * For A[i], it scores when it is placed at [A[i], n-1]
     * then it scores when it moves from current index i to j in [A[i],n-1]
     * and the K value for the move to j = (i-j+n)%n
     *
     * time complexity = O(n^2).
     */
    int bestRotation_cnt(vector<int>& A) {
        int n = A.size();
        vector<int> cnt(n, 0);
        for (int i = 0; i < n; ++i) {
            int val = A[i];
            for (int j = val; j < n; ++j) {
                ++cnt[(i-j+n)%n];
            }
        }
        int res = -1;
        int ms = INT_MIN;
        for (int i = 0; i < n; ++i) {
            if (ms < cnt[i]) {
                ms = cnt[i];
                res = i;
            }
        }
        return res;
    }
    /**
     * For rotation, append another A to A to form a 2*n length array B.
     * form an index array and compare with B to find out # of elements
     * whose diff with index is x.
     * let diff[x] = # of elements whose diff with its index is x, x may be
     * negative.
     *
     * Move index array rightward, and update diff accordingly:
     *  1, all diff's will be one larger
     *  2, except for the last element, whose diff is n-val.
     */
    int bestRotation_TLE1(vector<int>& A) {
        int n = A.size();
        int res = 0;
        int ms = 0;
        // map for diff count
        unordered_map<int, int> dc;
        // compute diff for the first position
        for (int i = 0; i < n; ++i) {
            ++dc[A[i]-i];
        }
        for (auto& p : dc) {
            if (p.first <= 0) {
                ms += p.second;
            }
        }
        
        for (int pre = 0; pre < n-1; ++pre) {
            --dc[A[pre]];
            unordered_map<int, int> ndc;
            for (auto& p : dc) {
                ndc[p.first+1] = p.second;
            }
            // deal with the previous first element, which is now at the end
            ++ndc[A[pre]-n+1];
            
            int score = 0;
            for (auto& p : ndc) {
                if (p.first <= 0) {
                    score += p.second;
                }
            }
            if (score > ms) {
                ms = score;
                res = pre+1;
            }
            dc.swap(ndc);
        }
        return res;
    }

private:
};

}

